import React from 'react';

const icons = {
  templates: (
    <svg width="40" height="40" fill="none" viewBox="0 0 24 24" className="text-blue-300/80"><rect x="3" y="5" width="18" height="14" rx="3" stroke="currentColor" strokeWidth="2"/><rect x="7" y="9" width="10" height="2" rx="1" fill="currentColor"/><rect x="7" y="13" width="6" height="2" rx="1" fill="currentColor"/></svg>
  ),
  create: (
    <svg width="48" height="48" fill="none" viewBox="0 0 24 24" className="text-blue-300/80"><circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="2"/><path d="M12 8v8M8 12h8" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
  discover: (
    <svg width="40" height="40" fill="none" viewBox="0 0 24 24" className="text-blue-300/80"><circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="2"/><path d="M12 8v4l3 3" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
};

const cards = [
  { 
    title: 'Templates',
    desc: 'Explore prebuilt workflows',
    color: 'blue-300/80',
    icon: icons.templates,
    gradient: 'from-blue-500/20 via-blue-500/10 to-transparent'
  },
  { 
    title: 'Create',
    desc: 'Build your own workspace',
    color: 'blue-300/80',
    icon: icons.create,
    gradient: 'from-blue-500/20 via-blue-500/10 to-transparent'
  },
  { 
    title: 'Discover',
    desc: 'Browse workflows from the community',
    color: 'blue-300/80',
    icon: icons.discover,
    gradient: 'from-blue-500/20 via-blue-500/10 to-transparent'
  },
];

export default function WelcomeScreen({ onCardClick }) {
  return (
    <div className="relative min-h-screen w-full bg-gradient-to-b from-zinc-900 via-black to-zinc-900">
      {/* Subtle background effects */}
      <div className="absolute inset-0 bg-[radial-gradient(circle_at_top_right,_rgba(59,130,246,0.08),_transparent_50%)]" />
      <div className="absolute inset-0 bg-[radial-gradient(circle_at_bottom_left,_rgba(168,85,247,0.08),_transparent_50%)]" />
      
      <div className="relative z-10 min-h-[80vh] flex flex-col items-center justify-center px-4 py-12">
        <div className="text-center mb-16">
          <h1 className="text-7xl font-extrabold mb-4 bg-gradient-to-r from-white via-blue-100 to-white bg-clip-text text-transparent"
              style={{
                letterSpacing: '0.15em',
              }}>
            SCOPE<sup className="text-3xl align-super ml-1">²</sup>
          </h1>
          <p className="text-2xl text-zinc-400 font-medium">
            Choose a trading workflow to get started
          </p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 max-w-6xl w-full px-6">
          {cards.map(card => (
            <button
              key={card.title}
              className="group focus:outline-none"
              onClick={() => onCardClick && onCardClick(card.title)}
              type="button"
            >
              <div className="relative">
                <div className="absolute -inset-1 bg-gradient-to-r from-blue-500/20 via-purple-500/10 to-blue-500/20 rounded-xl blur opacity-25 group-hover:opacity-40 transition duration-500" />
                <div className="relative bg-black/40 backdrop-blur-sm border border-zinc-800 rounded-xl p-8 transition-all duration-300 group-hover:border-blue-500/20">
                  <div className="mb-4 transform transition-transform duration-300 group-hover:scale-110 group-hover:text-blue-400">
                    {card.icon}
                  </div>
                  <h3 className="text-xl font-bold text-white mb-2 group-hover:text-blue-300 transition-colors">
                    {card.title}
                  </h3>
                  <p className="text-zinc-400">
                    {card.desc}
                  </p>
                </div>
              </div>
            </button>
          ))}
        </div>
      </div>
    </div>
  );
}
